Eligiblity:
Admission to M. Tech Programs is open to a student who passed; B.Tech. or an equivalent degree in the allied branch of Engineering with a minimum of 55% marks from a recognized University;
Or M.Sc. degree in a related branch with a minimum of 60% from a recognized University;
Or MBBS/BDS/BVSc/B.Pharma Or Bachelor in Physiotherapy / Occupational Therapy / Prosthetics & Orthotics of 4 years degree program with a minimum of 55% marks from a recognized university for Biomedical Engineering;
Or MCA degree with a minimum of 60% marks for Computer Engineering;
NOTE: AMIE / AMIETE graduates including graduates from other Govt. recognized professional bodies’ equivalent to AMIE with 50 % or above are also eligible with the condition that the branch adopted at graduation level must be the same as the specialization applied for. (Candidates with B.E./B.Tech. in any branch of Engineering, M.Sc.(Electronics), M.Sc.(Phy.), M.Sc.(Maths). BDS, MBBS or equivalent may be required to pass audit courses of maximum 6 credits in addition to regular courses.)

